#!/usr/bin/python# -*- coding:utf-8 -*-class MinStack:    def __init__(self):        self.stack = []    def push(self, number: int) -> None:        self.stack.append(number)    def pop(self) -> int:        return self.stack.pop()    def top(self) -> int:        return self.stack[-1]    def pop_min(self) -> int:        number = min(self.stack)        index = 0        for i in range(len(self.stack)):            if self.stack[i] == number:                index = i        self.stack.pop(index)        return numberif __name__ == '__main__':    stack = MinStack()